import ViewCourse from './ViewCourse';
import React from 'react'
import { Route } from "react-router";



function ViewCourseLink(course) {
	function handleClick(e) {
		e.preventDefault();
		console.log('Class was clicked.');
	}
	return (
		<a href="/course" onClick={handleClick}>
		{course.name}
		</a>
	);
}

const Courses = ({ courses }) => {
	return (
		<div>
		<center><h1>All Courses</h1></center>
		{courses.map((course) => (
			<div className="card">
			<div className="card-body">
			{ViewCourseLink(course)}
			<Link to="/course" component={ViewCourse}>test</Link>
			<h6 className="card-title">{course.rating}</h6>
			<h6 className="card-title">{course.numratings}</h6>
			<p className="card-title">{course.comments}</p>
			</div>
			</div>
		))}
		</div>
	)
};
export default Courses
